import React from 'react';

const CartPage = ({ cartItems, onCheckout }) => {
  return (
    <div>
      <h2>Cart</h2>
      {cartItems.length > 0 ? (
        cartItems.map((item, index) => (
          <div key={index}>
            <p>{item.name}</p>
            <p>{item.price}</p>
            <p>{item.description}</p>
          </div>
        ))
      ) : (
        <p>Your cart is empty</p>
      )}
      <button onClick={onCheckout}>Checkout</button>
    </div>
  );
};

export default CartPage;
